import React from "react";
import '../App.css';
import '../ProjectSection.css'

function ResumeSections(props) {
    return (
        <div className="project-card">
            <h2>{ props.title }</h2>
            <h4>{ props.dates }</h4>
            <p>{ props.body }</p>
        </div>
    );
}
export default ResumeSections;
